private static String getFieldType(DetailAST field) {
    String fieldType = null;
    final DetailAST identAst = field.findFirstToken(TokenTypes.TYPE)
            .findFirstToken(TokenTypes.IDENT);
    if (identAst != null) {
        fieldType = identAst.getText();
    }
    return fieldType;
}
